import React from "react";

class Home extends React.Component {
  render() {
    return(
      <header>
        <nav className="indigo"></nav>
        <div className="container">
          <h2 className="homeHeroHeading indigo darken-4 center">Indian Premier League</h2>
          <h4 className="homeHeroSubheading indogo darken-4 center">Eight weeks of power-packed cricketing action. </h4>
        </div>
      </header>
    )
  }
}

export default Home;
